import React from "react";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";
import axios from "axios";
import {
  TextField,
  Button,
  Typography,
  Box,
  Container,
  Grid,
  Paper,
} from "@mui/material";
import StudentList from "./StudentList";

const schema = yup.object().shape({
  firstName: yup.string().required().max(20),
  lastName: yup.string().required().max(20),
  email: yup
    .string()
    .required("Email is required")
    .email("Invalid email format"),
  phoneNumber: yup
    .string()
    .required()
    .matches(/^\d{10}$/, "Invalid phone number"),
  institutionName: yup.string().required().max(50),
  passOutYear: yup.number().required("Pass-out Year is required"),
  cgpiScore: yup.number().required("CGPI/Score is required"),
});

const Form = ({ setSubmitted }) => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(schema),
  });

  async function postData(student) {
    try {
      const response = await axios.post(
        "http://localhost:8080/api/students",
        student
      );
      return response.data;
    } catch (error) {
      console.error("Error posting data:", error);
      throw error;
    }
  }

  const onSubmit = (data) => {
    console.log(data);
    setSubmitted(true);
    postData(data)
      .then((responseData) => {
        console.log("Data posted successfully:", responseData);
        // Handle successful response
      })
      .catch((error) => {
        // Handle error
      });
  };

  return (
    <Container maxWidth="md">
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6}>
          <Typography variant="h4" align="center" gutterBottom>
            Student Registration Form
          </Typography>
          <Paper elevation={0} sx={{ p: 2, backgroundColor: "#FAF9F6" }}>
            <Typography
              variant="h6"
              sx={{ fontFamily: "Arial, sans-serif", fontWeight: "bold" }}
            >
              Basic Info
            </Typography>
            <form onSubmit={handleSubmit(onSubmit)}>
              <TextField
                {...register("firstName")}
                label="First Name"
                fullWidth
                error={!!errors.firstName}
                helperText={errors.firstName?.message}
                margin="normal"
              />
              <TextField
                {...register("lastName")}
                label="Last Name"
                fullWidth
                error={!!errors.lastName}
                helperText={errors.lastName?.message}
                margin="normal"
              />
              <TextField
                {...register("email")}
                label="Email"
                fullWidth
                error={!!errors.email}
                helperText={errors.email?.message}
                margin="normal"
              />
              <TextField
                {...register("phoneNumber")}
                label="Phone Number"
                fullWidth
                error={!!errors.phoneNumber}
                helperText={errors.phoneNumber?.message}
                margin="normal"
              />
              <Typography
                variant="h6"
                sx={{ fontFamily: "Arial, sans-serif", fontWeight: "bold" }}
              >
                Educational Background
              </Typography>
              <TextField
                {...register("institutionName")}
                label="Institution Name"
                fullWidth
                error={!!errors.institutionName}
                helperText={errors.institutionName?.message}
                margin="normal"
              />
              <TextField
                {...register("passOutYear")}
                label="Pass-out Year"
                fullWidth
                type="number"
                error={!!errors.passOutYear}
                helperText={errors.passOutYear?.message}
                margin="normal"
              />
              <TextField
                {...register("cgpiScore")}
                label="CGPI/Score"
                fullWidth
                type="number"
                error={!!errors.cgpiScore}
                helperText={errors.cgpiScore?.message}
                margin="normal"
              />
              <Box mt={2}>
                <Button variant="contained" type="submit">
                  Submit
                </Button>
              </Box>
            </form>
          </Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="h4" align="center" gutterBottom>
            Registered Students
          </Typography>
          <StudentList />
        </Grid>
      </Grid>
    </Container>
  );
};

export default Form;

